import React from 'react';
import {BrowserRouter, Route, Switch } from 'react-router-dom';
import Layouts from '../Pages/Layouts';
import Home from '../Pages/Home'
import Journal from '../LoginRegister/LoginRegister';
import Farmer from '../Pages/Farmer';
import Projects from '../Projects/Projects';

const AppRoute = ({ Component, path, exact, ...rest }) => {
    return (
        <Route exact={exact} path={path} {...rest} render={(props) => {
            return (
                <Layouts>
                    <Component {...rest} {...props} />
                </Layouts>
            )
        }} />
    )
}

const PrivateRoute = () => {
    return (
        <>
            <BrowserRouter>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <AppRoute exact path="/home" Component={Home} />
                    <AppRoute path="/farmer" Component={Farmer} />
                    <AppRoute path="/projects" Component={Projects} />
                    <AppRoute path="/designers" Component={Login} />
                    <AppRoute path="/apply" Component={ApplyYourKnow} />
                    <AppRoute path="/journal" Component={Journal} />
                    <AppRoute path="/faq" Component={Faq} />
              </Switch>
            </BrowserRouter>
        </>
    )
}
export default PrivateRoute;
